import React, { useState } from 'react';

const Compare = ({ note }) => {
  const [formData, setFormData] = useState({ start: '', end: '' });
  const [comparisonResult, setComparisonResult] = useState(null);

  const { start, end } = formData;

  const handleInputChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleCompare = () => {
    if (
      note &&
      note.estart &&
      typeof note.estart === 'string' &&
      note.estart.toLowerCase() === formData.start.toLowerCase()
    ) {
      // Comparison successful
      setComparisonResult('success');
    } else {
      // Comparison failed
      setComparisonResult('failure');
    }
  };

  return (
    <div>
      <h2>Enter Location</h2>
      <form>
        <div className="mb-3">
          <label htmlFor="start" className="form-label">
            Starting Position
          </label>
          <input
            type="text"
            className="form-control"
            id="start"
            name="start"
            value={start}
            onChange={handleInputChange}
          />
        </div>
        <button
          type="button"
          className="btn btn-primary"
          onClick={handleCompare}
        >
          Search
        </button>
      </form>

      {comparisonResult === 'success' && (
        <div>
          {/* Render the component or message when the comparison is successful */}
          <h3>Comparison Successful</h3>
          {/* Add your component or message here */}
        </div>
      )}

      {comparisonResult === 'failure' && (
        <div>
          {/* Render the component or message when the comparison fails */}
          <h3>Comparison Failed</h3>
          {/* Add your component or message here */}
        </div>
      )}
    </div>
  );
};

export default Compare;
